import React from 'react';
import { useObserver } from 'mobx-react-lite';
import { withRouter } from 'react-router-dom';
import { Box,Button } from '@material-ui/core'; //Button
import useStores from '@stores/useStores';
import FormControl from '@material-ui/core/FormControl';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';

const Lookup = () => {

    const { commonStore } = useStores();
    const {$Dim,$setAlert} = useObserver(() => ({
        $Dim: commonStore.Dim,
        $setAlert: commonStore.fSetAlert,
        // $Confirm: commonStore.Confirm,
        // $setConfirm: commonStore.fSetConfirm,
        // $setConfirmFunc: commonStore.fSetConfirmFunc,
      }));
      const Styles = fStyles($Dim);
    return (
        <>
        <Box  style={Styles.s1} display="flex" flexDirection="column" alignItems="center">
            <Box  style={{ width: $Dim * 500, height: $Dim * 200, marginTop: $Dim * 20  }} display="flex" flexDirection="column" alignItems="center" justifyContent="center">
                <div style={{display:'flex', marginTop:$Dim*-50}}>
                <Button variant="contained" style={{marginRight:$Dim * 5}}>초기화</Button>
                <Button variant="contained" style={{marginRight:$Dim * 5}}>품번확인</Button>
                </div>
            </Box>
            <Box  style={{ width: $Dim * 500, height: $Dim * 200, marginTop: $Dim * 20  }} display="flex" flexDirection="column" alignItems="center" justifyContent="center">
                <div style={{display:'flex',flexWrap:'wrap', marginTop:$Dim*-50}}>
             <FormControl fullWidth variant="outlined" style={{width:$Dim*400}}>
          <InputLabel htmlFor="outlined-adornment-amount">소분류</InputLabel>
          <OutlinedInput
            id="outlined-adornment-amount"
            labelWidth={60}
          />
        </FormControl>
        <FormControl fullWidth variant="outlined" style={{width:$Dim*400}}>
          <InputLabel htmlFor="outlined-adornment-amount">소분류</InputLabel>
          <OutlinedInput
            id="outlined-adornment-amount"
            labelWidth={60}
          />
        </FormControl>
                </div>
            </Box>
            
        </Box>
        </>
    );
};

const fStyles = ($Dim) => {
    return {
      s1: { width: $Dim * 1000, height: $Dim * 550, background: '#fff' },
      s2: { width: $Dim * 450, height: $Dim * 250,marginBottom: $Dim * 150, marginTop: $Dim * 220},
    };
  };

export default withRouter(Lookup);
